Structures: Abstract Profiles 

{% capture grouping_desc %}These are profiles on resources or data types that describe patterns used by other profiles, but cannot be instantiated directly.  I.e. instances can conform to profiles *based* on these abstract profiles, but do not declare conformance to the abstract profiles themselves.{% endcapture %}
    {{ grouping_desc | markdownify}}








                  MfgTestSiteOrganization

               {% capture desc %}A profile for the data elements required to identify an organization that manufactures, processes or tests drug products or substances.{% endcapture %}
{{ desc | markdownify}}




                  SponsorOrganization

               {% capture desc %}A profile for the data elements required to identify the sponsor of the drug products or substances.{% endcapture %}
{{ desc | markdownify}}






Structures: Resource Profiles 

{% capture grouping_desc %}These define constraints on FHIR resources for systems conforming to this implementation guide{% endcapture %}
    {{ grouping_desc | markdownify}}








                  Base64DocumentReference

               {% capture desc %}A profile that represents the document or diagram in base64.{% endcapture %}
{{ desc | markdownify}}




                  Component Substance

               {% capture desc %}Any raw material intended for use int he manufacture of a drug substance, or any ingredient intended for use in the manufacture of a drug product including those that may not appear in such drug product.{% endcapture %}
{{ desc | markdownify}}




                  Drug Product

               {% capture desc %}Includes the properties of the drug product, its components and impurities{% endcapture %}
{{ desc | markdownify}}




                  Drug Product Manufactured Instance

               {% capture desc %}Includes the properties of the drug product as manufactured.{% endcapture %}
{{ desc | markdownify}}




                  Drug Substance

               {% capture desc %}Drug Substance (Active Ingredient) nomenclature and characterizaiton{% endcapture %}
{{ desc | markdownify}}




                  Drug Substance Impurity

               {% capture desc %}Any component of the drug substance that is not the chemical entity.{% endcapture %}
{{ desc | markdownify}}




                  Polymorphic Form

               {% capture desc %}Alternate structure present inf the drug substance{% endcapture %}
{{ desc | markdownify}}






